import React from 'react';
import './custom-button.styles.scss';

const CustomButton = ({ children, isGoogleSignIn,...otherPorps }) =>(
    button = <button {...otherPorps} className= 'btn custom-button'>
                    {children}
                </button>


)

export default CustomButton
